import React from 'react';
import './css/Main.css';
import Puppy from '../static/images/puppy.png';

function Main() {
  return (
    <div id="mainPage">
      <img src={Puppy} alt="me"></img>
      <h1 id="mainTitle">hello</h1>
    </div>
  );
}

export default Main;
